import{
    Section,
    Title,
    ListOfReposContainer,
    Repo
} from './style';

const ReposContainer = props => {
    return(
        <Section>
            <Title>Reposit√≥rios de {(props.name).split('')[0]}</Title>
            <ListOfReposContainer>
                {(props?.repos).map(repo => (
                    <Repo onClick={() => window.loca} key={repo?.id}>
                        <h2>{repo?.name}</h2>
                        <p>{repo?.description}</p>                    
                    </Repo>
                ))}
            </ListOfReposContainer>
        </Section>
    );
}

export default ReposContainer;
